import React from 'react';
import tileData from './tileData';
import './componentes.scss';


const hola = [{title:'1',author:'ewrsdf'},{title:'1',author:'ewrsdf'},{title:'1',author:'ewrsdf'},{title:'1',author:'ewrsdf'}]

const Productos = hola.map(item, i => <tr key={i}> <td>{itme.title}</td> <td>{itme.author}</td> </tr>)

const Price = () =>(
    <table>
    <thead>
     <th>Producto</th>
     <th>Precio</th>
    </thead>
    <tbody>
    <Productos/>
    </tbody>
    </table>
)

export default Price;
